s data, and it also provides type safety for storage keys.", "The Storage API can be used in any part of the extension, including the background service worker, content scripts, and React hooks.", "The Storage API uses the chrome.storage API under the hood, but it provides a more convenient and type-safe interface.", "Developers can specify a storage area (sync, local, or managed) when creating a storage instance.", "The Storage API provides methods for setting, getting, and deleting data, as well as for listening for changes to storage."]}', '[0.027206747,0.038077906,-0.07132525,-0.00086809386,0.013505402,0.03507117,0.056036785,0.016308796,-0.019392189,0.053349826,0.03725945,0.020204883,0.02483039,0.04851759,-0.0027466216,-0.05521756,-0.026571948,-0.0030253942,-0.06429441,-0.016250161,-0.0858311,-0.013192717,-0.0741168,-0.05613143,-0.012376785,-0.047630917,0.04581682,-0.008488273,0.04045283,0.008823744,0.024798008,0.010405873,0.03331137,-0.013959582,-0.05638633,-0.07168429,-0.03053188,-0.010655034,0.017504927,0.014242048,-0.053233076,0.06514136,-0.007985608,-0.006313138,0.044807278,0.07332543,-0.033189222,0.04714254,-0.056005184,0.01439827,0.091838956,-0.031034872,-0.0446049,0.035428453,-0.006169333,-0.008118721,-0.039875094,0.01250982,0.03552114,-0.012843419,0.023852421,-0.02721168,-0.02810691,0.0031650378,0.020160634,0.011298042,-0.022272587,-0.0657979,-0.029871259,0.0045907185,-0.04179058,0.00024066435,-0.050222896,0.016198255,0.0035113464,-0.02780807,-0.012579603,0.04868583,0.010461824,0.020910716,-0.012767093,0.056123387,0.045525536,-0.01846725,0.08570568,0.010510491,-0.036467552,-0.03519704,-0.07074019,0.033760626,0.05632974,-0.027670862,0.03813365,0.022170011,-0.0131954225,-0.028422764,-0.042981267,-0.033828665,0.049285002,0.013509896,-0.02924102,0.002549801,0.005817,-0.08075976,-0.002201538,0.031749256,-0.0063986336,-0.02355534,0.0029135686,0.040284753,0.009032211,-0.008662942,0.024055323,-0.0056606466,-0.08309046,0.041848417,0.0419483,-0.026530059,0.001265